import React, { Component } from 'react';
export default class About extends Component {
  render() {
    let resumeData = this.props.resumeData;
    return (
      <React.Fragment>

      {/* About Section
   ================================================== */}
      <section id="about">
        <div className="row">
          <div className="three columns">
            <img className="profile-pic" src="images/profilepic.jpg" alt="" />
          </div>
          <div className="nine columns main-col">
            <h2>About Me</h2>
            <p align="justify">
              <b>I am seeking intern and full-time opportunities as a Software Engineer/Developer in the United States and willing to relocate everywhere in United States.</b> #OpenToWork To know more, download my resume or <a style={{color: '#FF8300'}} className="smoothscroll" href="#contact">contact me</a>.
            </p>
            <div className="row">
              <div className="columns contact-details">
                <h2>Contact Details</h2>
                <p className="address">
                  <span>Maithri Chullikana House</span><br />
                  <span>
                    <a href="https://goo.gl/maps/PoYwzn34Uu5vmYkL7" target="_blank">Mountain View, CA, USA</a>
                  </span><br />
                  <span><a href="mailto:maithrich3@gmail.com" target="_blank">maithrich3@gmail.com</a></span><br />
                </p>
              </div>
              <div className="columns download">
                <p>
                  <a href="https://drive.google.com/file/d/1Dae8x_drUtvLovSJbck_yJtsIU_ST2G0/view?usp=sharing" className="button" target="_blank"><i className="fa fa-download" />Download Resume</a>
                </p>
              </div>
            </div> {/* end row */}
          </div> {/* end .main-col */}
        </div>
      </section> {/* About Section End*/}
       </React.Fragment>
    );
  }
};
